Ingrédients (INCI) : Argile blanche Kaolin, source naturelle de minéraux.

Argile : utilisation en usage externe

En masque ou pansement

L'argile peut être posée directement sur la peau :
- en masque de beauté, sur l'ensemble du visage pour rééquilibrer les peaux grasses ou acnéiques : elle doit être retirée avant d'avoir complètement séché ;
- sur le cuir chevelu, en massage pour réguler la production de sébum, lutter contre les cheveux gras et éviter les pellicules ;
- en pansement localisé, pour traiter les boutons, de petites plaies ou brûlures, les abcès, etc.

Bon à savoir : l'argile risque de déshydrater la peau : il est donc conseillé de l'utiliser avec une huile végétale sur les épidermes sensibles. L'argile blanche, plus douce que la verte, est à privilégier.

En cataplasme : pour réaliser un cataplasme, on utilise de l'argile sous forme concassée. Après l'avoir réhydratée en la faisant tremper dans une petite quantité d'eau pendant une heure environ, on obtient une pâte que l'on étale en couche épaisse de deux centimètres environ sur un tissu. On l'applique sur la zone du corps à traiter, en la maintenant à l'aide d'une bande.

Les cataplasmes sont par exemple indiqués :

- pour soulager les articulations douloureuses ;
- en cas d'entorse ou de foulure du poignée, de la cheville ;
- sur les régions qui subissent une inflammation ;
- pour atténuer les courbatures, la fatigue musculaire, etc.


Utilisation de l'argile en usage interne : L'argile peut également être bue pour soulager différents troubles. Il suffit de diluer une cuillère à café de poudre d'argile dans un demi-verre d'eau, et laisser reposer au moins une demi-journée. Il est alors possible de ne consommer que l'eau trouble, en laissant le dépôt argileux au fond du verre. Cette option est largement conseillée lorsqu'on débute une cure d'argile.

Autre option, vous buvez la totalité du mélange, en ayant pris soin de l'agiter avant de boire.
